import { View, Text, Image } from 'react-native'
import React, { useState } from 'react'
import { Ionicons} from '@expo/vector-icons';
import { Switch } from 'react-native';
const TuyChonBanBe = () => {
  return (
    <View style={{flex:1}}>
      <View style={{ height: 50, alignItems: 'center', backgroundColor: 'white', flexDirection: 'row'}}>
                <Ionicons name="trash-outline" size={27} color="red" style={{ marginHorizontal: 15 }} />
                <Text style={{ textAlign: 'center', color: 'red' }}>Xóa lịch sử trò chuyện</Text>
            </View>
    </View>
  )
}

export default TuyChonBanBe
